import React, { useState, useRef } from "react";
import { InputText } from "primereact/inputtext";
import "./tareas.css";
import CardDemo from "../cards/card.component";
;

const TareasTable = ({ taskData }) => {
  console.log(taskData);
  return <div className="movieGallery">

    {
      taskData.movies.map(({cover,title,duration,genres,synopsis,releaseDate})=>{
        return <CardDemo key={title} cover = {cover} title = {title} duration = {duration} genres = {genres} synopsis = {synopsis} releasedate = {releaseDate}/>
      })
    }
  </div>
};

export default TareasTable;
